class Solution(object):
    def twoSum(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: List[int]
        """

        """
        This first part sorts the list and then adds pointers to the right and
        left sides of the list. Because the list is sorted in ascending order,
        it is easy to decrease the sum of left and right by moving the right
        to the left, and increase the sum by moving the left to the right.
        So eventually the two numbers that add up to target will be found.
        """
        sortedNums = sorted(nums)
        rightPointer = len(nums) - 1
        leftPointer = 0
        rightNum = 0
        leftNum = 0
        while True:
            added = sortedNums[leftPointer]  + sortedNums[rightPointer]
            if added == target:
                leftNum = sortedNums[leftPointer]
                rightNum = sortedNums[rightPointer]
                break
            if added < target:
                leftPointer += 1
            if added > target:
                rightPointer -= 1

        """
        Now that the numbers are found, we need to find two unique indices
        in the original list that contain the numbers. The firstIndex and
        secondIndex are initialized assigned -1 just to ensure reassignment occurs
        exactly once.
        """
        firstIndex = -1
        secondIndex = -1
        for i in range(len(nums)):
            if nums[i] == leftNum:
                if i != secondIndex and firstIndex == -1:
                    firstIndex = i
            if nums[i] == rightNum:
                if i != firstIndex and secondIndex == -1:
                    secondIndex = i
        return [firstIndex, secondIndex]

